import "./App.css";
import { useEffect, useState } from "react";

function App() {
  const [locations, setLocations] = useState();

  const fetchLocations = async () => {
    fetch("http://localhost:3000/locations")
  }

  useEffect(() => {
    fetchLocations();
  }, []);

  return <div className="App">hello world</div>;
}

export default App;
